import axios from 'axios'

export function UserSignUp(data) {
    return new Promise(() => {
        let axiosConfig = {
            headers: {
                'Content-Type': 'application/x-www-form-urlencoded'
            }
        };
        axios.post('http://localhost:8000/users/', data, axiosConfig)
            .then((response) => {
                console.log(response.data)
                //resolve(response.data)
            })
            .catch((error) => {
                console.log(error)
                //reject(error)
            })
    })
}
